import App from "./App";

function AppWithRouting() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/" element={<contact />} />
      </Routes>
    </BrowserRouter>
  );
}
export default AppWithRouting;
